import React from 'react'
import TrackVisibility from 'react-on-screen';
import 'animate.css';

export default function About() {
    return (
        <div className='aboutMe'>   
             <TrackVisibility>
                {({ isVisible }) =>
                    <div className={isVisible ? 'animate__animated animate__fadeIn' : ''}>  
                        <h1>About Me</h1>
                    </div>}
            </TrackVisibility>
            <h2>
                Welcome to Parkside Cafe and Sushi 
            </h2>
            <p>We are located in 602 12 Ave. SW Calgary, AB T2R</p>
            <p>We are specializing in providing our dear customers with a relaxing environment, meticulous service and exquisite dishes</p>
            <p>See you in Parside! Thank you!</p>
        </div>
    )
}
